&bc8=15&bc9=1','8937545353136','35313','These beautifully detailed golden shell earrings are lightweight and moveable with 3 concave hand crafted shell shapes made from from 14k gold plated silver. ','https://www.sorujewellery.com/cdn/shop/files/Earring13_01_9df33925-4477-4fb4-9867-35c28ba34cba_3000x.jpg?v=1716560913','Pink Dot Stud Earrings',4280000,'http://localhost:8080/api/v1/images/8937545353136',100,4771000,'S','2','SELL','earrings',5,2),(10,'https://free-barcode.com/barcodevn/barcode.asp?bc1=8931035380992&bc2=0&bc3=2.5&bc4=1.05&bc5=1&bc6=1&bc7=Arial&bc8=15&bc9=1','8931035380992','38099','Chic oval shaped stud earrings featuring an iridescent majorca pearl gemstone surrounded by sparkling golden yellow and opal crystals set as a mosaic sun motif.','https://www.sorujewellery.com/cdn/shop/files/Earring15_01_26441f6b-08d4-493e-a001-282cd7777029_3000x.jpg?v=1716560965','Yellow Sun Stud Earrings',4280000,'http://localhost:8080/api/v1/images/8931035380992',100,4771000,'S','2','SELL','earrings',5,2),(11,'https://free-barcode.com/barcodevn/barcode.asp?bc1=8932546820137&bc2=0&bc3=2.5&bc4=1.05&bc5=1&bc6=1&bc7=Arial&bc8=15&bc9=1','8932546820137','82013','These beautifully detailed golden shell earrings are lightweight and moveable with 3 concave hand crafted shell shapes made from from 14k gold plated silver. ','https://www.sorujewellery.com/cdn/shop/files/Earring2_01_cc2b7f17-4c1c-41f6-89df-09752639ec3f_3000x.jpg?v=1719481049','Marino Earrings',6600000,'http://localhost:8080/api/v1/images/8932546820137',100,7157000,'M','2','SELL','earrings',9.4,2),(12,'https://free-barcode.com/barcodevn/barcode.asp?bc1=8934224193397&bc2=0&bc3=2.5&bc4=1.05&bc5=1&bc6=1&bc7=Arial&bc8=15&bc9=1','8934224193397','19339','Super chic and beautifully detailed large gold and pearl stud earrings featuring a textured wrapped golden edge around a round centre pearl. Made in small batches, by hand in Italy from 18K gold plated silver. ','https://www.sorujewellery.com/cdn/shop/files/Earring18_01_3000x